ativa ADN, I.P. ho montante USD 944,275.00;\r\n3.	Construction of Sahen Irrigation Scheme — Manatuto and Manufahi Municipalities, Kustu  ADN, I.P. ho montante : IJSD \r\n4.	Construction Supervision of Sahen Irrigation Scheme — Manatuto and Manufahi Municipalities, Kustu estimativa ADN, I.P. ho montante USD 765,100.00.','2025-02-04','-','deliberasaun/Deliberasaun_No._05_II_CAFI_2025-MAPPF.pdf','anexo/Deliberasaun_No._05_II_CAFI_2025_-_MAPPF.pdf'),('Deliberasaun No. 06_II_CAFI_2025','MOP','Pedidu Aprovasaun no autorizasaun despezas no Konfirma Finansiamentu ba Projetu Emergensia:\r\n\r\n1.	Obra Konstrusaun ba Estrada Urbana Lugatoi Beloi Viqueque (Des. Nu. 002/PM/VII/2023. Dezenho no. 18;\r\n\r\n2.	Upgrading Roads Construction Bidau Santana — Culuhun to Habibie Bridge Sta. 0+000  1+118km, suco Bidau, Municipality Dili;\r\n\r\n3.	New Construction of Cyclop Retaining Wall in Tibar posto Bazartete, Municipio Liquiça','2025-02-04','-','deliberasaun/Deliberasaun_No._06_II_CAFI_2025-MOP.pdf','anexo/Deliberasaun_No._06_II_CAFI_2025MOP.pdf'),('Deliberasaun No. 08_II_CAFI_2025','MPIE/ADN.IP','Pedido Aprovasaun no autorizasaun ba Kustu Adisional — Variation Order no. I ba projetu \" New Construction ofMPO/ADN office\" ho montante $ 91,909.81.','2025-02-04','-','deliberasaun/Deliberasaun_No._08_II_CAFI_2025-_MPIE_ADN.pdf','anexo/Deliberasaun_No._08_II_CAFI_2025_-_ADN.pdf'),('Deliberasaun No. 09_II_CAFI_2025','TR','Pedido Aprovasaun no Autorizasaun despezas iha FI 2025 ba projetu \"New Construction of  the Judicial Courts of First Instance Building & Judges Residence at Municipality Viqueque,  Baucau, Ermera and Bobonaro\".','2025-02-04','-','deliberasaun/Deliberasaun_No._09_II_CAFI_2025-TR.pdf','anexo/Deliberasaun_No._09_II_CAFI_2025_-_TR.pdf'),('Deliberasaun No. 10_II_CAFI_2025','MPIE/UPI','Pedido Aprovasaun no Autorizasaun despezas ba Projetu Estudu Viabilidade ba projetu Barajem Mota Belulic iha Munisipiu Ainaro no Barajem Mota Carau ulun iha Munisipiu Manufahi.','2025-02-04'